import './App.css';
import { Route,BrowserRouter as Router} from "react-router-dom";
import Navi from './component/nav';
import Accuil from './pages/Accuil';
import ExP from './pages/ExP';
import Projets from './pages/Projets';
import For_dep from './pages/For_dep';
import { ToastContainer, toast } from 'react-toastify';
import yanis from './../src/yanis.png';
import {Link} from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <div className="entete row">
       <div className="photo_prof col-sm">
       <img src={yanis} alt="..." className="imgP rounded-circle"/>
       </div>
       <div className="desc col-sm">
         <h4>Nom : ALIM</h4>
         <h4>Prénom: Yanis</h4>
         <h4>Adresse mail : </h4>
         <h4>TélePhone : +33769070477</h4>
         <h4>Adresse : 6 rue pierre degetyer seclin,France </h4>
       </div>
       </div>
       <div className="btn-group lib" role="group" aria-label="Basic example">
     <button type="button" className="btn btn-secondary">Présentation</button>
  <button type="button" className="btn btn-secondary">Information personnelle</button>
  <button type="button" className="btn btn-secondary">Formations et diplomes</button>

  <button type="button" className="btn btn-secondary">Projet réalisé</button>
  <button type="button" className="btn btn-secondary">Outils et langages</button>
  <button type="button" className="btn btn-secondary">Langues</button>
  <button type="button" className="btn btn-secondary">centre d'intérêt</button>
</div>
<For_dep></For_dep>




      <Router>
     <Navi/>
     <Route path="/" exact component={Accuil}/>
     <Route path="/cnx" exact component={Accuil}/>
     <Route path="/name" exact component={Accuil}/>
     <Route path="/exp" exact component={ExP}/>
     <Route path="/Projets" exact component={Projets}/>
     <Route path="/formation" exact component={For_dep}/>

     </Router>

     <ToastContainer position={toast.POSITION.TOP_CENTER}/>

    </div>

  );
}

export default App;
